import React, { useState, useEffect } from 'react';
import Redirect from 'react-router'
import Grid from '@material-ui/core/Grid';
import { makeStyles } from '@material-ui/core/styles';
import TextEditor from './TextEditor';

const useStyles = makeStyles({
    divs: {
        height: '100vh',
    },
    div1: {
        backgroundColor: '#222751',
    },
    div2: {
        backgroundColor: '#282e5e',
    },
    div3: {
        backgroundColor: '#eee',
    },
});

const HomePage = () => {
    const classes = useStyles();

    useEffect(() => {
        fetch('localhost:5000/auth/github').then((res) => {
            return res.json()
        }).then((res) => {
            if (res.loggedIn === 'false') {
                <Redirect to="/"/>
            }
        })
    }, [])


    return (
        <div>
            <Grid container className={classes.divs}>
                <Grid item xs={3} className={classes.div1}></Grid>
                <Grid item xs={3} className={classes.div2}></Grid>
                <Grid item xs={6} className={classes.div3}>
                    <TextEditor />
                </Grid>
            </Grid>
        </div>
    );
};

export default HomePage;
